import React, { Component } from 'react';
import Movie from './Movie';

class MovieList extends Component {
    render(){
        return (
            <div>
               {MovieList.map((movie, id) => <Movie key={id} details={movie}/>)}
            </div>
        );
    }
}

export default MovieList;
